    class CharAndListSize(var char: Char, var size: Long)

    private fun removeCharThenReduce(charToRemove: Char, chars: MutableList<Char>): CharAndListSize {
        println("Testing char $charToRemove)")
        var copyOfChars = chars

        copyOfChars = copyOfChars.filter { it != charToRemove.toLowerCase() && it != charToRemove.toUpperCase() }.toMutableList()
        copyOfChars = removeReactions(copyOfChars)

        println("$charToRemove has list size of ${copyOfChars.size}")

        return CharAndListSize(charToRemove, copyOfChars.size.toLong())
    }

    private fun findTheShortestArrayRemovingCulprits(chars: MutableList<Char>): Long {
        var mainCulprit = alphabet[0]
        var shortestListSize: Long? = null
        alphabet.forEach { alphabetChar ->
            println("Testing char $alphabetChar)")
            var copyOfChars = chars

            copyOfChars = copyOfChars.filter { it != alphabetChar.toLowerCase() && it != alphabetChar.toUpperCase() }.toMutableList()
            copyOfChars = removeReactions(copyOfChars)
            if (shortestListSize == null || copyOfChars.size < shortestListSize!!) {
                println("Char $alphabetChar has produced the shortest so far")
                shortestListSize = copyOfChars.size.toLong()
                mainCulprit = alphabetChar
            }
        }
        println("Shortest list size $shortestListSize")
        println("Main culprit $mainCulprit")
        return shortestListSize!!
    }

    private fun removeReactions(chars: MutableList<Char>): MutableList<Char> {
        val initialSize = chars.size
        for (i in 0 until initialSize) {
            //iterating across max size
            var firstChar: Char? = null
            var secondChar: Char? = null
            for (index in 0 until chars.size) {
                firstChar = chars[index]
                secondChar = if (index + 1 < chars.size) chars[index + 1] else null
                if (secondChar != null && firstChar.equals(secondChar, true)
                    && ((firstChar.isUpperCase() && secondChar.isLowerCase()) || (firstChar.isLowerCase() && secondChar.isUpperCase()))) {
                    //println("Removing chars $firstChar & $secondChar")
                    chars.removeAt(index)
                    chars.removeAt(index) //
                    break
                }
            }
        }
        return chars
    }

